projectData.glsl:
#version 300 es
//This is the default shader for the shader editor!
//These functions are here and are written for the GLSL 3.0 specification.
//You can revert it to GLSL 1.0 by removing the version number

//our output for color
out highp vec4 fragColor;
//Base Variables
attribute highp vec4 a_position;
attribute highp vec4 a_color;
attribute highp vec2 a_texCoord;

varying highp vec4 v_color;
varying highp vec2 v_texCoord;

varying highp vec3 v_worldPos;
varying highp vec3 v_localPos;
uniform highp float u_timer;
uniform highp mat4 u_transform;

//Pen+ Textures
uniform mediump vec2 u_res;

//Our game
uniform highp float u_aspect;
uniform highp mat4 u_camera;
uniform highp mat4 u_model;
uniform sampler2D u_skin;

//For the color pallete
uniform sampler2D u_pallete;
uniform highp float u_palleteLength;

//Lighting
uniform highp vec4 lightPositions[64];
uniform highp vec4 lightColors[64];
uniform highp float lightCount;

//Fancy stuff
uniform highp float u_rendermode;

//Base functions

//Some missing math functions
highp float log10(highp float a) {
  return log(a)/log(10.0);
}

highp float eulernum(highp float a) {
    return 2.718 * a;
}

//Psuedorandomness
highp vec4 pcg4d(highp vec4 v)
{
    v = v * 1664525.0 + 1013904223.0;

    v.x += v.y*v.w;
    v.y += v.z*v.x;
    v.z += v.x*v.y;
    v.w += v.y*v.z;

    v.x += v.z*v.w;
    v.y += v.y*v.x;
    v.z += v.x*v.w;
    v.w += v.y*v.x;

    return vec4(v);
}

highp vec4 daveRandomRange(highp float lowR, highp float highR)
{
    lowp float r = (gl_FragCoord.x * 50.25313532) + (gl_FragCoord.y * 21.5453) + u_timer;
    highp float randomizer = r*r/u_timer/5398932.234523;
    return clamp(vec4(
    fract(sin(mod(randomizer*(91.3458), 1440.0)) * 47453.5453),
    fract(sin(mod(randomizer*(80.3458), 1440.0)) * 48456.5453),
    fract(sin(mod(randomizer*(95.3458), 1440.0)) * 42457.5453),
    fract(sin(mod(randomizer*(85.3458), 1440.0)) * 47553.5453)
    ), lowR, highR);
}

highp vec3 rotate_model(highp vec3 position) {  
  highp vec3 temp = position;

  position.x = temp.z * u_model[0][0] + temp.x * u_model[0][1];
  position.z = temp.z * u_model[0][1] - temp.x * u_model[0][0];

  temp = position;

  position.y = temp.z * u_model[1][0] + temp.y * u_model[1][1];
  position.z = temp.z * u_model[1][1] - temp.y * u_model[1][0];

  temp = position;

  position.x = temp.y * u_model[2][0] + temp.x * u_model[2][1];
  position.y = temp.y * u_model[2][1] - temp.x * u_model[2][0];

  position += vec3(
    u_model[0][2],
    u_model[1][2],
    u_model[2][2]
  );

  return position;
}

highp vec4 rotate(highp vec3 position) {
  position -= vec3(
    u_camera[0][2],
    u_camera[1][2],
    u_camera[2][2]
  );

  highp vec3 temp = position;

  position.x = temp.z * u_camera[0][0] + temp.x * u_camera[0][1];
  position.z = temp.z * u_camera[0][1] - temp.x * u_camera[0][0];

  temp = position;

  position.y = temp.z * u_camera[1][0] + temp.y * u_camera[1][1];
  position.z = temp.z * u_camera[1][1] - temp.y * u_camera[1][0];

  temp = position;

  position.x = temp.y * u_camera[2][0] + temp.x * u_camera[2][1];
  position.y = temp.y * u_camera[2][1] - temp.x * u_camera[2][0];

  return vec4(position,position.z * u_camera[0][3]) * u_camera[1][3];
}

void vertex() {
  gl_Position = rotate(rotate_model(a_position.xyz)) - vec4(0,0,1,0);

  v_worldPos = rotate_model(a_position.xyz);
  v_localPos = gl_Position.xyz / u_camera[1][3];

  gl_Position.x *= u_aspect;
  v_color = a_color;
  v_texCoord = a_texCoord;
}

//Fragment Shader
void fragment() {
  fragColor = vec4(0);

  //Remove fog for now
  //fragColor.xyz /= clamp(length(v_localPos), 1.0, 999999.0);

  if (u_rendermode == 1.0) {
    if (mod(gl_FragCoord.x + gl_FragCoord.y,2.0) == 1.0) {
      discard;
    }
  }

  for (highp float i=0.0;i<64.0;++i) {
    if (i>=lightCount) {
      break;
    }

    //Our light calc
    fragColor.xyz += lightColors[int(i)].xyz * lightPositions[int(i)].w / 
                  pow(
                    length(lightPositions[int(i)].xyz - v_worldPos) / lightColors[int(i)].w,
                    2.0
                  );
  }

  fragColor *= texture(u_skin,fract(v_texCoord));
  fragColor.w = 1.0;

  if (texture(u_skin,fract(v_texCoord)).w == 0.0) {
    discard;
  }

  highp vec4 closestColor = vec4(999);
  for (highp float i=0.0;i<256.0;++i) {
    if (i>=u_palleteLength) {
      break;
    }

    if (length(fragColor - texture(u_pallete,vec2(i/u_palleteLength,0))) < length(fragColor - closestColor)) {
      closestColor = texture(u_pallete,vec2(i/u_palleteLength,0));
    }
  }

  fragColor = closestColor;
}

